need the sun shining to convert toelectricity. Solarpanels can still convert from solar energy to electrical or thermal power even on a cloudy day (although not at the same capacity)<\/p><h3>Unlimited Power<\/h3><p>While everyone else is crying and whining about gas prices and high energy costs - you will have an unlimited supply of solar power. Unless the sun blows up and destroys our entire solar system - you won't really need to worry about never having power.<\/p><h3>Tax Incentives<\/h3><p>Once you invest into solar, you are eligible for Federal, State, Provincial And Utility Tax incentives and rebates. These aren't the'$30 off' from your coffee maker rebates - they add up big time! For example, in Australia, if you spend $16,000 on a solar set up, they will rebate you up to $8000 back. This doesn't include other rebates you can get either. You'll need to check your own country's government policies - but, in the next 5-10 years - all countries will be jumping on the solar bandwagon.<\/p><h3>Not Just A 'One Time' Set Up + Easy Installation<\/h3><p>With solar, you don't need to invest into a bunch of costly arraysrightaway. You're able to set up one panel at a time, and add additional panels whenever you feel the time is right. Furthermore,installing a solar panel is actually quite a lot easier than peoplethink. You can do it yourself, or have an installer come and have itset up for you the same day.<\/p><\/div>"));qD(b,50,d);rD(b)};_.cM={10:1,21:1};_=_P.prototype=$P.prototype=new u;_.gC=function aQ(){return Hq};_.vc=function bQ(a){var b,c,d,e;b=new tD;d=ll(a.g,43);c=this.b.G;e=de(d.y)+10;wA(b,new KB(c));qD(b,50,e);rD(b)};_.cM={10:1,21:1};_.b=null;_=dQ.prototype=cQ.prototype=new u;_.gC=function eQ(){return Iq};_.vc=function fQ(a){var b,c,d;b=new tD;c=ll(a.g,43);d=de(c.y)+10;wA(b,new KB("<div><h1>Installation Guidelines<\/h1><br><p>The power of a solar system tells you how much energy it CAN produce, and is measured by the unit of power, kilowatts (kW). This measure is telling you how big the system is, or in other words, what it's capacity to produce power is. The amount of energy a solar system will produce is measured in kilowatt hours (kWh) ?which remember, is just another way of talking about energy which is otherwise measured in joules. Site your solar panel array where there will be no regular shading. This is the first and most obvious step to making sure your system does not suffer the consequences of being partially shaded.<\/p><br><p>It is extremely important to consider all times of day for all seasons of the year when working out whether some nearby object might cast a shadow onto your roof. You can check this yourself or alternatively your Solar Choice broker will check to ensure there is no shading on your roof using a program called Nearmap. Solar system owners should also be vigilant in making sure that there are no nearby trees which might grow tall enough to eventually cause shading issues. Solar system lifespans are typically expected to be 25+ years, during which time trees have plenty of time to grow. Clouds are another source of potential shading.<\/p><br><p>Clouds passing through the sky during the day may also result in fluctuations in system output, but these are basically unavoidable. Amorphous silicon solar cells are said to be better at handling shading than crystalline silicon solar panels, but generally speaking the relatively low overall efficiency of amorphous panels means that crystalline modules are a better choice. There are some other technologies under development that may offer high efficiencies even in inclement weather, such as 'super black' solar cells, but most of these are still either expensive or not yet commercially available.<\/p><br><p>Roof space available for solar panels. One obvious factor to be taken into consideration when mounting panels on a roof is the amount of space available on it. A typical polycrystalline or monocrystalline panel measures about 1.6m x 1m, and depending on the capacity (size in watts) of your system, for an average 2 or 3-bedroom home, you should be able to fit enough panels to significantly offset your electricity costs on one, or in a stretch, two parts of your roof. Closeness of the panels to your home is not an absolute requirement: the roofs of sheds, garages, and balconies that stand slightly apart from your house may also provide options for placement.<\/p><\/div>"));qD(b,50,d);rD(b)};_.cM={10:1,21:1};_=nQ.prototype=gQ.prototype=new dw;_.gC=function oQ(){return Jq};var hQ;_=sQ.prototype=pQ.prototype=new Jx;_.gC=function tQ(){return Kq};var qQ=null;_=EQ.prototype=uQ.prototype=new u;_.gC=function FQ(){return Mq};_.tS=function GQ(){return DQ(this)};_.cM={48:1,74:1};_.f=null;_.g=null;_.i=null;_.j=null;_.k=null;_.n=null;_=LQ.prototype=IQ.prototype=new u;_.gC=function MQ(){return Nq};_.tS=function NQ(){return SU+HR(this.b)+cS};_.cM={48:1};_.b=null;_=_Q.prototype=OQ.prototype=new u;_.gC=function aR(){return Oq};_.tS=function bR(){return $Q(this)};_.cM={48:1};_.b=null;_.c=null;_.d=null;_.e=null;_.f=null;_.g=null;_.i=null;_.j=null;_=GR.prototype=cR.prototype=new u;_.gC=function IR(){return Qq};_.tS=function JR(){return FR(this)};_.cM={48:1};_.e=null;_.f=null;_.g=null;_=LR.prototype=KR.prototype=new ic;_.gC=function MR(){return Pq};_.cM={48:1,57:1,67:1,75:1};var RR=Jc;var Lp=FI(UU,'Object'),tl=FI(VU,'AjaxKeyConstants_'),Rp=FI(UU,$R),ir=EI(WU,'String;'),ul=FI(VU,'AjaxLoader$1'),Sp=FI(UU,'Throwable'),Bp=FI(UU,'Exception'),El=FI(XU,'Animation'),vl=FI(XU,'Animation$1'),Dl=FI(XU,'AnimationScheduler'),wl=FI(XU,'AnimationScheduler$AnimationHandle'),Cl=FI(XU,'AnimationSchedulerImpl'),zl=FI(XU,'AnimationSchedulerImplTimer'),yl=FI(XU,'AnimationSchedulerImplTimer$AnimationHandleImpl'),Sq=EI('[Lcom.google.gwt.animation.client.','AnimationSchedulerImplTimer$AnimationHandleImpl;'),cn=FI(YU,'Timer'),xl=FI(XU,'AnimationSchedulerImplTimer$1'),Bl=FI(XU,'AnimationSchedulerImplWebkit'),Al=FI(XU,'AnimationSchedulerImplWebkit$Animati
